import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
  EmptyState
} from '@shopify/polaris';
import '@shopify/polaris/styles.css';
import  './index.css';


class ShoppingList extends React.Component {
  render() {
    return (
      <div className="shopping-list">
        <h1>Shopping List for {this.props.name}</h1>
        <ul>
          <li>Instagram</li>
          <li>WhatsApp</li>
          <li>Oculus</li>
        </ul>
      </div>
    );
  }
}
const Index = () => (
  
  <Page>

    <Layout>
      <div className="header">
      <Card>
        <p>Esta es una tarjetota</p>
      </Card>
      </div>

    </Layout>
  </Page>
);



export default Index;
